import React from 'react';
import {TodoItem} from "./TodoItem";
import './Todos.css';

export const Todos = (props) => {
    return (
        <div className='container'>
            <h1>Welcome to Todo Application</h1>
            <TodoItem todo={props.todo}/>
        </div>)
};
